{"result":"@-moz-document domain(roblox.com) {

  .avatar-status {
    animation: animate 5s linear infinite, glow 1.5s ease-in-out infinite alternate;
    background-color: #c08bfc;
    border-radius: 50%;
    width: 20px;
    height: 20px;
    box-shadow: 0 0 10px #c08bfc;
  }

  @keyframes animate {
    0% {
      filter: hue-rotate(0deg) sepia(100%) saturate(200%);
    }

    100% {
      filter: hue-rotate(360deg) sepia(100%) saturate(200%);
    }
  }

  @keyframes glow {
    0% {
      box-shadow: 0 0 10px #c08bfc, 0 0 20px #c08bfc, 0 0 30px #c08bfc;
    }
    100% {
      box-shadow: 0 0 20px #c08bfc, 0 0 40px #c08bfc, 0 0 60px #c08bfc;
    }
  }
}"}
